/* eslint-disable jsx-a11y/anchor-is-valid */

import React,{useEffect} from 'react'
import {ProxyModel} from 'app/modules/history/models/Account'
import ComputerItem from './components/ComputerItem'
import { useDispatch, useSelector, shallowEqual } from 'react-redux'
import { actions } from './redux/AccountRedux'
import { RootState } from 'setup'
import {Input} from "reactstrap";
type Props = {
  className: string,
}

const ComputerList: React.FC<Props> = ({ className }) => {
  const dispatch = useDispatch()

  useEffect(() => {
    dispatch(actions.requestProxies())
  }, [])

  const proxies:ProxyModel[] = useSelector<RootState>(({ histories }) => histories.proxies, shallowEqual) as ProxyModel[] || []
  let sum_total=0;
  let sum_die=0;
  for (var i = 0; i < proxies.length; i++) {
      if(proxies[i].state==0){
        sum_die=sum_die+1
      }
  }
  return (
    <div className={`card ${className}`}>
      {/* begin::Header */}
      <div className="page-header" style={{backgroundColor:'#c0e1ce'}}>
        <div className="page-header__content">
          <div className="align-items-center row" style={{margin:10}}>
            <div className="col-lg-7 col-sm-12 c-order__header">
              <span  className='fw-bolder fs-3 mb-1'>Danh sách Proxy</span>
              <span  className='ml-2 fw-bold fs-7'>(Tổng: {proxies.length}|Die: {sum_die})</span>
            </div>
          </div>
        </div>
      </div>
      {/* end::Header */}
      {/* begin::Body */}
      <div className='card-body py-3'>
        {/* begin::Table container */}
        <div className='table-responsive'>
          {/* begin::Table */}
          <table className='table table-row-dashed table-row-gray-300 align-middle gs-0 gy-4'>
            {/* begin::Table head */}
            <thead>
              <tr>
                <th className='min-w-10px'>#</th>
                <th className='min-w-100px'>IpV4</th>
                <th className='min-w-100px'>port</th>
                <th className='min-w-100px'>Time</th>
                <th className='min-w-100px'>State</th>
                <th className='min-w-100px'>Geo</th>
              </tr>
            </thead>
            {/* end::Table head */}
            {/* begin::Table body */}
            <tbody>
              {
                proxies&&proxies?.map((item: ProxyModel,index:number) => {
                  return <ComputerItem key={"ipv4-"+index} item={item} index={index}/>
                })
              }

            </tbody>
            {/* end::Table body */}
          </table>
          {/* end::Table */}
        </div>
        {/* end::Table container */}
      </div>
      {/* begin::Body */}
    </div>
  )
}

export default ComputerList
